import React, { Component } from 'react';
import MapContact from "../components/Map";
import FormContact from "../components/FormContact";

export default class Contacto extends Component {
    render() {
        const latC = -40.5725
        const longC = -73.1353
        const zoomC = 15
        const popupC = "Corretajes Bull"
        const height = 300
        return (
            <>
                <MapContact
                    lat={latC}
                    long={longC}
                    zoom={zoomC}
                    popup={popupC}
                    height={height}
                />
                <FormContact />
            </>
        )
    }
}
